const void * PAL_LoadOverlayBMP(int *length)
{
	void *bmp = malloc(PAL_OverlayBMPLength());
	uint32_t *ptr = (uint32_t *)((uint8_t *)bmp + sizeof(bmp_header));
	const uint32_t *cnt = bmp_data;

	memcpy(bmp, bmp_header, sizeof(bmp_header));
	while(cnt < bmp_data + (sizeof(bmp_data) / sizeof(uint32_t)))
	{
		if (*cnt & 0x80000000)
		{
			memcpy(ptr, cnt + 1, (*cnt & 0x7fffffff) << 2);
			ptr += (*cnt & 0x7fffffff);
			cnt += (*cnt & 0x7fffffff) + 1;
		}
		else
		{
			memset(ptr, 0, *cnt << 2);
			ptr += *cnt++;
		}
	}

	return bmp;
}

